import React, { Component } from 'react';
import FoodMenu from '../Assets/JSON/FoodMenu.json';

class CardMenu extends Component{
  constructor(props){
    super(props);
  }

  componentWillMount() {
    const { menuToShow } = this.props;
    console.log(menuToShow); 

    this.setState({
      foodMenu: FoodMenu.FoodMenus[menuToShow]
    })
  }

  render() {

const { menuID, menuInnerID } = this.props;
    return (

      <div id={menuID} className="flip-menu-card">
        <div id={menuInnerID} className="flip-menu-card-inner">
          <div className="flip-menu-card-front">
          </div>
          <div className="flip-menu-card-back">
            {this.state.foodMenu.map((menu, index) => {
              console.log(menu.title);
            return ( 
              <div>
                <h3>{menu.title}</h3>
                <p>Pris: {menu.price}</p>
              </div>
            )
           })}

          </div>
        </div>
      </div>

      )
  }
} 

export default CardMenu;
